import React, { Component } from "react";

class SkillRow extends Component {
  constructor(props) {
    super(props);
    this.callCheckAPI = this.getSkills.bind(this);
    }


  render () {
    return (
    <tr>
      <td></td>
      <td className="skillMod">{this.props.mod}</td>
      <td className="skillName">{this.props.name}</td>
      <td className="skillBonus">
        <button className="skillBonusButton" name="Arcana">{this.props.bonus}</button>
      </td>
    </tr>
    );
  }
};

export default SkillRow;
